            if (packResponse.AuthorOverrideOption.IsSet)
                writer.WriteString("authorOverride", packResponse.AuthorOverride);

            if (packResponse.UpdatedDateOption.IsSet)
                writer.WriteNumber("updatedDate", packResponse.UpdatedDateOption.Value!.Value);

            if (packResponse.StartDateOption.IsSet)
                writer.WriteNumber("startDate", packResponse.StartDateOption.Value!.Value);

            if (packResponse.EndDateOption.IsSet)
                writer.WriteNumber("endDate", packResponse.EndDateOption.Value!.Value);

            var packTypeRawValue = PackResponse.PackTypeEnumToJsonValue(packResponse.PackTypeOption.Value!.Value);
            writer.WriteString("packType", packTypeRawValue);
            if (packResponse.PackOrderOption.IsSet)
                writer.WriteNumber("packOrder", packResponse.PackOrderOption.Value!.Value);

            if (packResponse.AppKeyOption.IsSet)
                writer.WriteString("appKey", packResponse.AppKey);

            if (packResponse.ApplicationOption.IsSet)
            {
                writer.WritePropertyName("application");
                JsonSerializer.Serialize(writer, packResponse.Application, jsonSerializerOptions);
            }
            if (packResponse.InGameOption.IsSet)
                writer.WriteBoolean("inGame", packResponse.InGameOption.Value!.Value);

            if (packResponse.HighestOption.IsSet)
                writer.WriteBoolean("highest", packResponse.HighestOption.Value!.Value);

            if (packResponse.AllocateTicketsOption.IsSet)
                writer.WriteBoolean("allocateTickets", packResponse.AllocateTicketsOption.Value!.Value);

            if (packResponse.TicketTypeOption.IsSet)
                writer.WriteString("ticketType", packResponse.TicketType);

            if (packResponse.TicketCountOption.IsSet)
                writer.WriteNumber("ticketCount", packResponse.TicketCountOption.Value!.Value);

            if (packResponse.PointsOption.IsSet)
                writer.WriteNumber("points", packResponse.PointsOption.Value!.Value);
        }
    }
}
